function Asc(String){return String.charCodeAt(0)}function Chr(AsciiNum){return String.fromCharCode(AsciiNum)}function encriptar(texto){let mensx="",l,i,j=0,vetorAscii=[],ch=sessionStorage.getItem("chavePhpsession");const lchavePhp=chavePhp.length,ldado=texto.length;for(i=0;i<ldado;i++)j++,l=Asc(texto.substr(i,1))+Asc(ch.substr(j,1)),j==lchavePhp&&(j=1),l>255&&(l-=256),mensx+=Chr(l),vetorAscii.push(l);return mensx=vetorAscii.join(","),mensx}function descriptar(texto){let mensx="",l,i,j=0;const listAscci=texto.split(",");let ch=sessionStorage.getItem("chavePhpsession");const lchavePhp=chavePhp.length,ldado=listAscci.length;for(i=0;i<ldado;i++)j++,l=parseInt(listAscci[i])-Asc(ch.substr(j,1)),j==lchavePhp&&(j=1),l<0&&(l+=256),mensx+=Chr(l);return mensx}function descriptar1(texto){let mensx="",l,i,j=0,ch=sessionStorage.getItem("chavePhpsession");const lchavePhp=chavePhp.length,ldado=texto.length;for(i=0;i<ldado;i++)j++,l=Asc(texto.substr(i,1))-Asc(ch.substr(j,1)),j==lchavePhp&&(j=1),l<0&&(l+=256),mensx+=Chr(l);return mensx}function encriptar1(texto){let mensx="",l,i,j=0,listAscci,ch=sessionStorage.getItem("chavePhpsession");const lchavePhp=chavePhp.length,ldado=texto.length;for(i=0;i<ldado;i++)j++,l=Asc(texto.substr(i,1))+Asc(ch.substr(j,1)),j==lchavePhp&&(j=1),l>255&&(l-=256),mensx+=Chr(l);return mensx}function mostrarDadoNormal(dado){return console.log("Dado normal: "+dado),dado}function mostrarDadoEncriptado(dado){const dadoEncriptado=encriptar(dado);return console.log("Dado original encriptado: "+dadoEncriptado),dadoEncriptado}function mostrarDadoDescriptado(dado){const dadoOriginal=descriptar(dado);return console.log("Dado original desencriptado: "+dadoOriginal),dadoOriginal}